// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./contratoEntrega.sol";
import "./contratoPago.sol";

contract Pedido {
    address public contratoEntrega;
    address public contratoPago;

    enum StateType {
          Generado,
          Preparando,
          Entregado,
          Terminado,
          Compensado,
          Indefinido
    }

    StateType public State;

    event StatusPedido(StateType State, address contratoEntrega, address contratoPago);

    constructor() public payable  {
        State = StateType.Indefinido;
        contratoEntrega = address(0);
        contratoPago = address(0);
    }

    function updateEstado(uint  estado, address contEntrega, address contPago) public {
        if (contEntrega == address(0)){
            contEntrega = contratoEntrega;
        }
        if (contPago == address(0)){
            contPago = contratoPago;
        }
        if (estado == 1 || estado == 2){
            require(contEntrega != address(0));
            Entrega miEntrega = Entrega(contEntrega);
            if (estado == 1){
                State = StateType.Preparando;
                miEntrega.activate(contPago);
            }
            if (estado == 2){
                State = StateType.Entregado;
                miEntrega.consummation(address(this));
            }
        }
        if (estado == 0){
            State = StateType.Generado;
            contratoPago = contPago;
            contratoEntrega = contEntrega;
        }
        if (estado == 3){
            State = StateType.Terminado;
        }
        if (estado == 4){
            State = StateType.Compensado;
        }
        emit StatusPedido(State, contEntrega, contPago);
    }

    function getState() public returns(uint){
        uint result;
        if (State == StateType.Generado) {
            result = 0;
        }
        if (State == StateType.Preparando) {
            result = 1;
        }
        if (State == StateType.Entregado) {
            result = 2;
        }
        if (State == StateType.Terminado) {
            result = 3;
        }
        if (State == StateType.Compensado) {
            result = 4;
        }
        if (State == StateType.Indefinido) {
            result = 5;
        }
        return result;
    }

    function deposit() public payable {}

    function resolutionPedido(uint resolution, address contCompensacion) public {
        require(State == StateType.Entregado, "Aun no se ha entregado el pedido. Como puede saber como ha ido?");
        payEther(resolution, contCompensacion);
    }

    function payEther(uint resolution, address contCompensacion) private {
        uint amount = address(this).balance;
        Pago miPago = Pago(contratoPago);
        miPago.deposit{value: amount}();
        miPago.decideWhotoPay(address(this), resolution, contCompensacion);
    }
}

contracts/contratoProducto.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./contratoPedido.sol";

contract Producto {

    address public seller;
    address payable public buyer;
    uint public price;
    address public contratoPedido;
    address public contratoEntrega;
    address public contratoPago;
    address public contratoCompensacion;

    event ListAdress(address buyer, address seller, address contratoPedido, address contratoEntrega, address contratoPago, address contratoCompensacion);
    event PurchasedItem(string producto, uint price);

    constructor(address cPedido, address cEntrega, address cPago, address cCompensacion) public payable {
        buyer = payable(msg.sender);
        contratoPedido = cPedido;
        contratoEntrega = cEntrega;
        contratoPago = cPago;
        contratoCompensacion = cCompensacion;
    }

    function updateAndBuyProducto(string memory producto, uint precio, address vendedor) public payable {
        require(msg.sender==buyer);
        seller = vendedor;
        price = precio;
        require(msg.value >= precio, "Tienes que poner Ether para poder comprarlo");
        emit ListAdress(buyer, seller, contratoPedido, contratoEntrega, contratoPago, contratoCompensacion);
        emit PurchasedItem(producto, price);
        buy();
    }

    function buy() private {
        Pedido miPedido = Pedido(contratoPedido);
        if (price > address(this).balance){
            miPedido.updateEstado(3,contratoEntrega, contratoPago);
            require(price <= address(this).balance, "No hay suficiente ether en este contrato.");
        } else {
            miPedido.deposit{value: price}();
            miPedido.updateEstado(0, contratoEntrega, contratoPago);
            uint amount = address(this).balance;
            (bool success, ) = buyer.call{value: amount}("");
            require(success, "Fallo enviando Ether");
        }
    }
}

